import React from 'react';
import { shallowEqual, useSelector, useDispatch } from 'react-redux';

import './RentBike.css';

import { mockRentBike } from '../../mockRentBike/mockRentBike'
import RentBikeItem from '../RentBikeItem';

const RentBike = () => {

    const rentBike = useSelector(state => state.listBike.rent, shallowEqual)

    const onCancelRent = (id) =>{
        console.log(id)
    };

    const element = rentBike.map(({ id, ...items }) => {
        return (
            <RentBikeItem
                key={id}
                items={items}
                onCancel={() => onCancelRent(id)}/>
        )
    })

    return (
        <div className="rentBike">
            <h3 className="title font-weight-bold">Your rent (Total: $12.99)</h3>
            <div className="listRentBike">
                {element}
            </div>
        </div>
    );
};

export default RentBike;
